// you can use custom javascript code here, it will be bound to the
// scope of the current op, which is available as `op`.
// 
// have a look at the documentation at:
// https://docs.cables.gl/dev_hello_op/dev_hello_op.html

const inSecret = op.inString("secret","")
const inAmount = op.inString("amount", "")
const inTriggerSendTx = op.inTriggerButton("sendTx")
const outLedger = op.outString("ledger")
const outAccount = op.outString("account")
const inDestinationAddress = op.inString("Destination", "")
let client = new xrpl.Client("wss://s.altnet.rippletest.net:51233");


inTriggerSendTx.onTriggered = async () => {
    await client.connect();
    console.log(inSecret)
    const wallet = xrpl.Wallet.fromSecret(inSecret.value)
    outAccount.set(wallet.address)

  // Prepare transaction -------------------------------------------------------
  const prepared = await client.autofill({
    "TransactionType": "Payment",
    "Account": wallet.address,
    "Amount": xrpl.xrpToDrops(inAmount.value),
    "Destination": inDestinationAddress.value
  })
  const max_ledger = prepared.LastLedgerSequence
  console.log("Prepared transaction instructions:", prepared)
  console.log("Transaction cost:", xrpl.dropsToXrp(prepared.Fee), "XRP")
  console.log("Transaction expires after ledger:", max_ledger)

  // Sign prepared instructions ------------------------------------------------
  const signed = wallet.sign(prepared)
  console.log("Identifying hash:", signed.hash)
  console.log("Signed blob:", signed.tx_blob)

  // Submit signed blob --------------------------------------------------------
  const tx = await client.submitAndWait(signed.tx_blob)


  // Wait for validation -------------------------------------------------------
  // submitAndWait() handles this automatically, but it can take 4-7s.

  // Check transaction results -------------------------------------------------
  console.log("Transaction result:", tx.result.meta.TransactionResult)
  console.log("Balance changes:", JSON.stringify(xrpl.getBalanceChanges(tx.result.meta), null, 2))
}

